local oc = oc or function(...) return ... end

function ragJoint(hit,r,d)
    Spawn(oc(function()
    d = d or 0
    local rpar,r0,r1 = r.Parent,r.Part0,r.Part1
    if d > 0 then wait(d) end
    local p = hit:Clone()
    p:BreakJoints()
    p:ClearAllChildren()
    p.FormFactor = "Custom"
    p.Size = p.Size/2
    p.Transparency = 1
    p.CanCollide = true
    p.Name = "Colliduh"
    p.Parent = hit
    local w = Instance.new("Weld",p)
    w.Part0 = hit
    w.Part1 = p
    w.C0 = CFrame.new(0,-p.Size.Y/2,0)
    local rot = Instance.new("Rotate",rpar)
    rot.Name = r.Name
    rot.Part0 = r0
    rot.Part1 = r1
    rot.C0 = r.C0
    rot.C1 = r.C1
    r0.Velocity = Vector3.new()
    r1.Velocity = Vector3.new()
    r:Destroy()
    end))
end


