        spawn(function()
            firefx.Transparency=0
            wait()
            firefx.Transparency=1
        end)
        spawn(function()
            flash.Enabled=true
            for i=1,2 do
                wait()
                slideweld1.C0=slideweld1.C0*cfn(0,0,0.22) 
            end
            flash.Enabled=false
