mouse.KeyDown:connect(function(k)
	k=k:lower()
	if k=='e' then
		if attack==false and mana>=20 then
			Push()
		end
		elseif k=='g' then
		if attack==false and mana>=50 then
			Twirl()
		end
		elseif k=='v' then
		if attack==false and mana>=25 then
			MagicJump()
		end
		elseif k=='q' then
		if attack==false then
		idle=1000
		end
		elseif k=='h' then
		if attack==false then
		mana=100
		end
		elseif k=='y' then
		if attack==false and mana>=100 then
			Shred()
		end
		elseif k=='f' then
		if attack==false and mana>=40 then
			Spin()
		end
		elseif k=='r' then
		if attack==false and mana>=20 then
			Clap()
		end
		elseif k=='t' then
		if attack==false then
			Hai()
		end
		elseif k=='0' then
		if attack==false then
			Humanoid.WalkSpeed=(56)
		end
		elseif k=='j' then
		if attack==false then
			Humanoid.Health = 100
			print("Congrats, you commited suicide.")
		end
	end
end)

function MagicCircle(brickcolor,cframe,x1,y1,z1,x3,y3,z3,delay)
local prt=part(3,workspace,0,0,brickcolor,"Effect",vt(0.5,0.5,0.5))
prt.Anchored=true
prt.CFrame=cframe
local msh=mesh("SpecialMesh",prt,"Sphere","",vt(0,0,0),vt(x1,y1,z1))
game:GetService("Debris"):AddItem(prt,2)
coroutine.resume(coroutine.create(function(Part,Mesh) 
for i=0,1,delay do
wait()
Part.CFrame=Part.CFrame
Part.Transparency=i
Mesh.Scale=Mesh.Scale+vt(x3,y3,z3)
end
Part.Parent=nil
end),prt,msh)
end

